def normaliza(minVal,maxVal, value):				
	vn=((2 * (value - minVal)) / (maxVal - minVal))-1
	return vn

def sigmoid(z):
	return 1.0/(1.0+np.exp(-z))

def tgHiperbolica(z):
	return 2.0/(1.0+np.exp(-2*z))-1 

